import React from 'react';
import './Menu.css';
import {menuItemsData} from './data';
import MenuItem from './MenuItem/MenuItem';

const Menu = () => {
  return(
  <main>
    {menuItemsData.map((item) => (
      <MenuItem item={item}/>
    ))}
  </main>
  )
};

export default Menu;
